import React from 'react';
import {Nav, 
  NavLink, 
  NavMenu,
} from './NavBarElements';

const Navbar = () => {
  return (
    <>
      <Nav>
        
        <NavMenu >
          <NavLink to="/about" activeStyle={{color:'black'}} style={{
          textDecoration:'none',
          color:'white'
          }}>
            Log In
          </NavLink>
          <NavLink to="/services" activeStyle={{color:'black'}} style={{
          textDecoration:'none',
          color:'white'
          }}>
            Services
          </NavLink>
          <NavLink to="/contact-us" activeStyle={{color:'black'}} style={{
          textDecoration:'none',
          color:'white'
          }}>
            Contact
          </NavLink>
          <NavLink to="/Form" activeStyle={{color:'black'}} style={{
          textDecoration:'none',
          color:'white'
          }}>
            Sign Up
          </NavLink>
        </NavMenu>
      </Nav>
    </>
  );
};

export default Navbar;
